import './Layout.css'; 
import React from 'react';
import { Link } from 'react-router-dom';  // Import from React Router if you're using it
import Header from './Header';            // Ensure Header is imported
import Sidebar from './Sidebar';          // Ensure Sidebar is imported

export default function Layout({ children }) {
    return (
        <div className="layout-container">
            <Header>
                <nav className="header-nav" aria-label="Main navigation">
                    <ul className="nav-links">
                        <li>
                            <Link to="/shoppingcart" aria-label="View shopping cart">Shopping Cart</Link>
                        </li>
                    </ul>
                </nav>
            </Header>
            <div className="main-content">
                <Sidebar />
                <main className="content-area">
                    {children}
                </main>
            </div>
        </div>
    );
}


